  input: TEXT,F3XA,,"In response to your letter of November 4, 2005 regarding our
    April Monthly Report (3/1/05-3/31/05), this amendment corrects Schedule D.  The
    negative entries in this schedule are offset by positive entries, and the difference
    is the balance owed.  Schedule B items totaling $20,052.85 for direct Mail Fundraising
    Exp, Telemarketing, Postage, Direct Mail Exp./Fundraising were NOT for any candidate,
    but rather were fundraising expenses for the party itself.  The expenditures made
    for 'Fundraising Consultants' and 'Even Cost Reimb' were also incurred in connection
    with the party's fundraising efforts FOR THE PARTY.  There should have been no
    entry to H2.  Our administrative costs were limited for the last few months.  As
    indicated many times, we have no rent expense since the foundation that owns this
    building leases it to us for $1.00 per year.  I have corrected all other items
    on this amendment.  Thank you."
